//3rd party
import React from 'react';
import {Router, Route, Switch, Redirect} from 'react-router-dom';

function App() {
  return (
    <Router history={history}>
      <div>
        <Header />
        <Switch>
          <Route exact path="/" component={HomePage} />
          <Route exact path="/login" component={LoginForm} />
          <Route exact path="/register" component={Registration} />
          <Route exact path="/home" component={HomePageLoggedIn} />
          <Route exact path="/author/:penname" component={AuthorProfile} />
          <Route exact path="/gerbil/new" component={StoryCreate} />
          <Route exact path="/gerbil/building" component={StoryBuilder} />
          <Route exact path="/gerbil/adopting" component={AdoptingGerbil} />
          <Route exact path="/gerbil/:storyid/storyblock/:storyblockid" component={storyBlockList} />
          <Route exact path="/passthegerbil" component={PassTheGerbilEditor} />
          <Route exact path="/settings" component={SettingsPage} />
          <Route exact path="/genre/:genre" component={GenreRollMain} />
          <Route path="/Page-Not-Found" component={NotFound} />
          <Redirect to="/Page-Not-Found" />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
